s etc) are in high demand.&nbsp;Several thousand people are&nbsp;homeless and there is also immense damage to&nbsp;public buildings, churches and homes. &nbsp; We&nbsp;need volunteers to help with&nbsp;rebuilding efforts, building makeshift&nbsp;accommodation and clearing of debris.</span></p><ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 13px;\"><li style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 14pt;\"><span style=\"box-sizing: border-box; color: #5040ae;\"><strong style=\"box-sizing: border-box; font-weight: bold;\">Healthcare and Medical</strong></span></span></li></ul><p style=\"box-sizing: border-box; margin: 0px 0px 20.8px;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">There is a great need of medical volunteers in&nbsp;the form of doctors and nurses to administer&nbsp;basic first aid and treat people who have&nbsp;suffered trauma and injury. We also need&nbsp;medical volunteers to travel to rural areas and&nbsp;project locations to treat people in need.</span></p><ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 13px;\"><li style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-size: 14pt;\"><span style=\"box-sizing: border-box; color: #5040ae;\"><strong style=\"box-sizing: border-box; font-weight: bold;\">Childcare &amp; Support</strong></span></span></li></ul><p style=\"box-sizing: border-box; margin: 0px 0px 20.8px;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">The children at the projects we work with and&nbsp;others around the island who have been&nbsp;through this terrible ordeal would have&nbsp;suffered a great deal of trauma and loss.</span></p></div>','Caretaker of orphanange','Suva, Fiji','Hotel','Breakfast',11,74,'2017-09-14',0,0),(5,8,'Medical awareness maker','Apple pie chupa chups jelly-o muffin apple pie chupa chups tart powder. Croissant chupa chups caramels I love lollipop chupa chups biscuit. I love sweet toffee marzipan cake macaroon jelly tiramisu candy canes','<h3 style=\"box-sizing: border-box; font-family: Cabin; line-height: 1.1; color: #363c48; margin-top: 26px; margin-bottom: 13px; font-size: 26px;\"><span style=\"box-sizing: border-box; color: #ff9900;\">Overview</span></h3><div class=\"paragraph\" style=\"box-sizing: border-box; color: #222324; font-family: Lato; font-size: 16px;\"><p style=\"box-sizing: border-box; margin: 0px 0px 20.8px;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">On February 21, 2016 the largest cyclone ever recorded in the southern hemisphere tore through the Fijian islands, straight over the main island of Viti Levu with 650,000 population.</span></p><p style=\"box-sizing: border-box; margin: 0px 0px 20.8px;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">Cyclone Winston, &nbsp;with wind gusts of 325kmh and waves up to 12m high left scenes of destruction with peoples homes and livelihoods devastated in the wake of the storm.</span></p><p style=\"box-sizing: border-box; margin: 0px 0px 20.8px;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">The cyclone has caused widespread flash flooding and power outages, including in the country&rsquo;s capital of Suva. &nbsp;Entire outer island communities with weaker infrastructure have been completely destroyed and vulnerable to food and water scarcity and disease.</span></p></div><div class=\"paragraph\" style=\"box-sizing: border-box; color: #222324; font-family: Lato; font-size: 16px;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">TC Winston devastated many sources of local livelihood especially in agricultural communities whose main source of income is farming. &nbsp;The outcome has forced many families to be homeless and dependent on relief goods and services. &nbsp;Tens of thousands of people have been forced from their homes and living in evacuation centers.</span></div><div class=\"paragraph\" style=\"box-sizing: border-box; color: #222324; font-family: Lato; font-size: 16px;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">&nbsp;</span></div><div class=\"paragraph\" style=\"box-sizing: border-box; color: #222324; font-family: Lato; font-size: 16px;\"><span style=\"box-sizing: border-box; font-size: 14pt;\">&bull; The estimated recovery time is expected between 18 and 24 months</span><br style=\"box-sizing: border-box;\" /><span style=\"box-sizing: border-box; font-size: 14pt;\">&bull; Power won&rsquo;t be fully restored until August 2016</span><br style=\"box-sizing: border-box;\" /><span style=\"box-sizing: border-box; font-size: 14pt;\">&bull; The state of emergency ends 20MAR, however it&rsquo;s expected to be extended for another 1-2 months for some regions</span><br style=\"box-sizing: border-box;\" /><span style=\"box-sizing: border-box; font-size: 14pt;\">&bull; There is a severe lack of timber and seeds at the moment due to the agricultural damage caused by Winston</span><br style=\"box-sizing: border-box;\" /><span style=\"box-sizing: border-box; font-size: 14pt;\">&bull; Homes and businesses won&rsquo;t be touched for many weeks through the North Central regions</span><br style=\"box-sizing: border-box;\" /><span style=\"box-sizing: border-box; font-size: 14pt;\">&bull; The maritime Islands will take an extremely long time to assess as it&rsquo;s costing $20,000FJ per 3-4 day trip out there to assess them &ndash; some of these areas are catastrophically damaged compared to Viti Levu (main island)</span><br style=\"box-sizing: border-box;\" /><span style=\"box-sizing: border-box; font-size: 14pt;\">&bull; Sugar and Rice farming have also significantly suffered</span></div><div class=\"paragraph\" style=\"box-sizing: border-box; color: #222324; font-family: Lato; font-size: 16px;\"><h3 style=\"box-sizing: border-box; font-family: Cabin; line-height: 1.1; color: #363c48; margin-top: 26px; margin-bottom: 13px; font-size: 26px;\"><span style=\"box-sizing: border-box; color: #ff9900;\">Location</span>